package com.crystalcg.gamedev.util.cache.domain;
/**
 * 联盟等级表
 * @author zhaibiao
 *
 */
public class StaticAllianceGrade {
   private int allianceLevel;
   private int upgradeNeedWealth;
   private int upgradeNeedTime;
   private int memberLimit;
   private int barrackLimit;
public int getAllianceLevel() {
	return allianceLevel;
}
public void setAllianceLevel(int allianceLevel) {
	this.allianceLevel = allianceLevel;
}
public int getUpgradeNeedWealth() {
	return upgradeNeedWealth;
}
public void setUpgradeNeedWealth(int upgradeNeedWealth) {
	this.upgradeNeedWealth = upgradeNeedWealth;
}
public int getUpgradeNeedTime() {
	return upgradeNeedTime;
}
public void setUpgradeNeedTime(int upgradeNeedTime) {
	this.upgradeNeedTime = upgradeNeedTime;
}
public int getMemberLimit() {
	return memberLimit;
}
public void setMemberLimit(int memberLimit) {
	this.memberLimit = memberLimit;
}
public int getBarrackLimit() {
	return barrackLimit;
}
public void setBarrackLimit(int barrackLimit) {
	this.barrackLimit = barrackLimit;
}
 
   
}
